import React from 'react';
import s from './Users.module.css';


const Users = (props) => {
    let users = props.users.map((u) => <div key={u.id}>
        <span>
            <div>
                <img src={u.ava}/>
            </div>
            <div>
                <button>Follow</button>
            </div>
        </span>
        <span>
            <div></div>
            <div></div>
        </span>
        <span>
            
        </span>
        <span>{u.status}</span>
        <span>{u.followed}</span>
        <span>{u.location.city}</span>
    </div>);
    return (
        <div>
            {users}
        </div>
    )
}

export default Users;
